import React, { useEffect, useRef } from 'react';

const LineGraph = (props) => {

    return (
      <div id="LineGraph-Container">
          <div className="LineGraph-Background">
            <div className="LineGraph-Content">
                <div className="LineGraph-Content-Row-1">
                    <div className="LineGraph-Scores">
                        <p>50</p>
                        <p>40</p>
                        <p>30</p>
                        <p>20</p>
                        <p>10</p>
                        <p>0</p>
                    </div>
                    <div className="LineGraph-Display">
                        <LineGraphComponent></LineGraphComponent>
                    </div>
                </div>
                <div className="LineGraph-Content-Row-2">
                    <div className="LineGraph-Dates">
                        <p>DD/MM</p>
                        <p>DD/MM</p>
                        <p>DD/MM</p>
                        <p>DD/MM</p>
                    </div>
                </div>
            </div>
          </div>
      </div>
    );
  };

const LineGraphComponent = () => {

    const width = 200;
    const height = 200;
    const canvasRef = useRef(null);

    const LineGraphData = () => {
        console.log("sad");
    };

    useEffect(() => {
        const canvas = canvasRef.current;
        const ctx = canvas.getContext('2d');
        const data = [
            { x: 0, y: 30 },
            { x: 50, y: 70 },
            { x: 100, y: 20 },
            { x: 150, y: 80 },
            { x: 200, y: 50 },
          ];

        // Clear the canvas
        ctx.clearRect(0, 0, width, height);
        // Draw the line graph
        ctx.beginPath();
        ctx.moveTo(data[0].x, data[0].y);

        for (let i = 1; i < data.length; i++) {
          ctx.lineTo(data[i].x, data[i].y);
        }
        ctx.strokeStyle = 'blue';
        ctx.lineWidth = 2;
        ctx.stroke();
        }, [data, width, height]);

    return <canvas ref={canvasRef} width={width} height={height} style={{ border: '5px solid #ccc' }} />;
};



  export default LineGraph;
